css:
.editor-colors {
  background-color: #ffffff;
  color: #333333;
}
.editor {
  font-family: 'Espresso Mono', Inconsolata, Monaco, Consolas, 'Courier New', Courier, monospace;
}
.editor .invisible-character,
.editor .indent-guide {
  color: #e1e1e1;
}
.editor .gutter {
  background-color: #f8f8f8;
}
.editor .gutter .line-number {
  opacity: 1;
  color: #777777;
}
.editor .gutter .line-number.folded,
.editor .gutter .line-number:after,
.editor .fold-marker:after {
  color: #777777;
}
.editor .cursor {
  border-color: #535353;
}
.editor .selection .region {
  background-color: #cfe9ff;
  border-radius: 2px;
}
.editor .line-number.cursor-line-no-selection {
  background-color: #cfe9ff;
}
.bracket-matcher {
  background-color: rgba(137, 198, 243, 0.1);
  border-radius: 2px;
  border: 1px solid #5fafef;
}
.comment {
  color: #adadad;
  font-style: normal;
}
.entity {
  color: #2f6f9f;
}
.keyword {
  color: #699d36;
}
.storage.type {
  color: #699d36;
}
.constant {
  color: #f93232;
}
.constant.numeric,
.constant.boolean {
  color: #2aa198;
}
.variable {
  color: #5fafef;
}
.delimiter,
.brace {
  color: #000000;
}
.delimiter.period {
  color: #699d36;
}
.invalid.deprecated {
  text-decoration: underline;
  color: #f93232;
}
.invalid.illegal {
  color: #f93232;
}
.string {
  color: #e9ad1a;
}
.string .constant.character.escape {
  color: #f93232;
}
.string.regexp {
  color: #2aa198;
}
.string.regexp .source.ruby.embedded,
.string.regexp .string.regexp.arbitrary-repitition {
  color: #f93232;
}
.css .entity {
  color: #5fafef;
}
.css .property-name {
  color: #f93232;
}
.css .variable {
  color: #699d36;
}
.css .constant,
.css .unit {
  color: #6700b9;
  background-color: rgba(118, 83, 119, 0.07);
  border-radius: 3px;
}
.css .quoted {
  color: #e9ad1a;
}
.html .tag,
.xml .tag {
  color: #5fafef;
}
.html .entity,
.xml .entity {
  color: #2f6f9f;
}
.html .entity.name,
.xml .entity.name {
  background-color: rgba(137, 198, 243, 0.1);
  border-radius: 3px;
}
.html .comment,
.xml .comment {
  color: #adadad;
}
.html .attribute-name,
.xml .attribute-name {
  color: #5fafef;
}
.html .quoted,
.xml .quoted {
  color: #f93232;
}
.html .quoted .punctuation,
.xml .quoted .punctuation {
  color: #2f6f9f;
}
.html .js .quoted,
.xml .js .quoted {
  color: #e9ad1a;
}
.gfm .link {
  color: #000000;
  font-weight: bold;
}
.gfm .link .entity {
  color: #e9ad1a;
  font-weight: normal;
}
.gfm .link .link {
  color: #699d36;
  font-weight: normal;
}
.gfm .heading {
  font-weight: bold;
  color: #000000;
}
.gfm .list,
.gfm .hr {
  color: #f93232;
}
.gfm .quote {
  font-style: italic;
  color: #2f6f9f;
}
.gfm .raw {
  color: #6700b9;
}
.gfm .raw .support {
  color: #f93232;
  font-weight: bold;
}
.json .punctuation {
  color: #333333;
}
.json .punctuation.separator {
  color: red;
}
.json .quoted {
  color: #2f6f9f;
  background-color: rgba(137, 198, 243, 0.1);
  border-radius: 3px;
}
.json .constant {
  color: #6700b9;
  background-color: rgba(118, 83, 119, 0.07);
  border-radius: 3px;
}
.yaml .entity.name {
  background-color: rgba(137, 198, 243, 0.1);
}
.yaml .string .punctuation {
  color: #777777;
}
.ruby .entity.name {
  color: #6700b9;
}
.ruby .string {
  color: #f93232;
}
.erb .embedded.erb {
  color: #6700b9;
  background-color: rgba(118, 83, 119, 0.07);
  border-radius: 3px;
}
.erb .embedded.erb .variable {
  color: #47007f;
}
.erb .embedded.erb .punctuation {
  color: #6700b9;
}
